import Typewriter from 'typewriter-effect';

export default function Home() {
    return (
        <div className="container ">
            <h1><Typewriter
                onInit={(typewriter) => {
                    typewriter
                        .typeString('Hello, <br />')
                        .callFunction(() => { console.log('String typed out!'); })
                        .typeString('my name is Yung-Chu, <br />')
                        .pauseFor(2500)
                        .deleteAll()
                        .callFunction(() => {
                            console.log('All strings were deleted');
                        })
                        .start();
                }}
            />
            </h1>
        </div>

        // <div className="container ">
        //     <h1>Hello, <br />
        //         my name is Yung-Chu, <br />
        //         <div className='typing'>and I am a <Typewriter
        //             options={{
        //                 strings: ['designer.', 'gamer.', 'researcher.', 'developer.'],
        //                 autoStart: true,
        //                 loop: true,
        //                 delay: 60,
        //                 deleteSpeed: 30,
        //                 pauseFor: 250,
        //                 skipAddStyles: false,
        //             }}
        //         />
        //         </div>
        //     </h1>
        // </div >

    );
};
